import React, {Component} from 'react';
import './product.css';
import Axios from "axios";

class AllProduct extends Component {

    constructor() {
        super();
        this.state={
            products:[]
        }
    }



    componentDidMount() {

        Axios.get("http://localhost:2001/evaly/api/product/")
            .then(res=>{

                this.setState({
                    products:res.data
                })
            })
            .catch(error=>{
                console.log(error)
            })

    }


    render() {
        return (
            <div className="productList">

                    <img src={this.state.image}/>
                    <p className="productname">{this.state.name}</p>
                    <p className="discription">{this.state.discription}</p>
                      <p className="price">{this.state.price}</p>
            </div>
        );
    }
}

export default AllProduct;
